const white = "#FFFFFF";
const black = "#e8ebe5";
const palette = {
	black,
	white,
	primary: {
		contrastText: black,
		main: "#00FF00",
	},
	secondary: {
		contrastText: "black",
		main: "#808080",

	},
	text: {
		primary: "#000000",
		secondary: black
	},
	background: {
		default: "#f7f7f7",
		paper: white,
	},
	icon: {
		main: "#808080",
	},

};

export default palette;
